import { StatusBar } from 'expo-status-bar';
import React, {useState, useEffect} from 'react';
import { StyleSheet, Text, View, ActivityIndicator, SafeAreaView, FlatList,Image, Dimensions } from 'react-native';
import {MaterialCommunityIcons} from "@expo/vector-icons"
export default function App() {

 return (
  <View style={styles.container}>
     <StatusBar backgroundColor={colors.background} barStyle="dark-content"/>
      <View
      style={{
        padding:16,
        flexDirection:"row",
        justifyContent:"space-between"
      }}
      >
      <View >
          <Text style={{fontSize:16}}>COVID-19</Text>
          <Text style={{fontsize:16}}>Viá»‡t Nam</Text>
      </View>
          <MaterialCommunityIcons
          name="thermometer"
          size={45}
          style={{color: colors.white, backgroundColor: colors.themeColor}}
          />
      </View>
      <View 
          style={{
            borderTopWidth:6,
            borderTopColor: colors.themeColor,
            borderRadius:3

          }}
      />
      <View style={{paddingHorizontal: 8, paddingVertical:30}}>
          <FlatList 
              numColumns={2}
              data={symptoms}
              keyExtractor={item=> item.symptom}
              renderItem={({item})=>(
                <Symptom 
                symptom={item.symptom}

                />
                )}
          />
      </View>


  </View>
  );
};
const screenWidth=Dimensions.get("window").width

const colors={
  themeColor:"#ffc66a",
  white:"#fff",
  background:"#f4f6fc",
  greyish:"a5a5a5"
};
const symptoms=[{
  symptom: "cold",

  selected: true
},{
  symptom: "Dry Cough",

  selected: false
},{
  symptom: "Fever",

  selected: false
},{
  symptom: "Breathing Difficutly",

  selected: false
}];

const Symptom=({symptom,icon,selected})=>{
  return(
    <View 
    style={{
      backgroundColor:colors.white,
      margin:8, 
      borderRadius:20,
      paddingVertical:20,
      paddingHorizontal: 24,
      width:(screenWidth-64)/2
    }}
    >
    <Text
    style={{
      fontSize:20,
      fontWeight:"700",
      color:colors.greyish
    }}
    >
    {symptom}
    </Text>
    <Text>dddddddddddddhahah</Text>
    <MaterialCommunityIcons name={icon}/>
    </View>
    )

  }

  const styles = StyleSheet.create({
    container: {
      flex: 1,
      backgroundColor: colors.background,
      paddingHorizontal:8

    }
  });
